Het indrukwekkende verhaal over een all-star American breakdance groep die met de hulp van hun strenge coach hun dromen proberen na te leven. Dromen die vaak door de maatschappij en eigen familie niet worden begrepen. Hun levens lijken te botsen in Frankrijk waar hun vaardigheden aan de ultieme test worden onderworpen tijdens de &quot;Battle of the Year&quot;-finale. Hier komen dansgroepen uit 18 verschillende landen bij elkaar om te strijden voor het wereldkampioenschap.



